import { useAuth } from '../context/AuthContext';
import { Link } from 'react-router-dom';

export default function Navbar() {
  const { user, logout } = useAuth();

  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
      <div className="container-fluid">
        <Link className="navbar-brand" to="/">Quán Cà Phê</Link>
        <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarNav">
          <ul className="navbar-nav ms-auto">
            <li className="nav-item"><Link className="nav-link" to="/">Trang chủ</Link></li>
            {user ? (
              <>
                <li className="nav-item"><Link className="nav-link" to="/tables">Đặt bàn</Link></li>
                <li className="nav-item"><Link className="nav-link" to="/menu">Menu</Link></li>
                <li className="nav-item">
                  <Link className="nav-link" to="/order">Đơn hàng</Link>
                </li>
                <li className="nav-item"><button className="nav-link btn btn-link" onClick={logout}>Đăng xuất</button></li>
              </>
            ) : (
              <>
                <li className="nav-item"><Link className="nav-link" to="/login">Đăng nhập</Link></li>
                <li className="nav-item"><Link className="nav-link" to="/register">Đăng ký</Link></li>
              </>
            )}
          </ul>
        </div>
      </div>
    </nav>
  );
}
